func GetWebHtml() {
	webUrl := `https://www.douyu.com/g_LOL`
	resp, err := http.Get(webUrl)
	HandleError(err, "http.get")
	bytesOfHtml, err := ioutil.ReadAll(resp.Body)
	HandleError(err, "Read")
	contentHtml := string(bytesOfHtml)

	//爬主播名字
	reZhuBoName := regexp.MustCompile(`"></use></svg><div class="DyListCover-userName is-template">(.*?)</div></h2></div></div></a><a href="`)
	nameRes := reZhuBoName.FindAllStringSubmatch(contentHtml, -1)

	//爬热度
	reHot := regexp.MustCompile(`</h3></div><div class="DyListCover-info"><span class="DyListCover-hot is-template"><svg><use xlink:href="#icon-hot_8a57f0b"></use></svg>(.*?)</span><h2 class="DyListCover-user is-template">`)
	hotRes := reHot.FindAllStringSubmatch(contentHtml, -1)

	//爬分区
	reSectionName := regexp.MustCompile(`<span class="DyListCover-zone">(.*?)</span><h3 class="DyListCover-intro" title="`)
	sectionNameRes := reSectionName.FindAllStringSubmatch(contentHtml, -1)

	//爬直播间标题
	resRoomName := regexp.MustCompile(`<h3 class="DyListCover-intro" title="(.*?)">.*?</h3>`)
	roomNameRes := resRoomName.FindAllStringSubmatch(contentHtml, -1)

	//爬直播间具体地址
	resRoomURL := regexp.MustCompile(`</div></h2></div></div></a><a href="/(.*?)" target="_blank"></a></div></li><li class="layout-Cover-item">`)
	roomURLRes := resRoomURL.FindAllStringSubmatch(contentHtml, -1)

	originWebUrl := `https://www.douyu.com/`
	for index := 0; index < 100; index++ {
		fmt.Println("分区：", sectionNameRes[index][1], "\t主播：", nameRes[index][1], "\t\t\t直播间标题:", roomNameRes[index][1], "\t\t热度：", hotRes[index][1], "\t直播间地址为:", originWebUrl+roomURLRes[index][1])
	}

}
